// frontend/src/components/ForecastResult.js
import React from 'react';

function ForecastResult({ forecastData }) {
  if (!forecastData) {
    return (
      <div className="forecast-result">
        <h3>Forecast Overview</h3>
        <p style={{ color: '#777' }}>
          No forecast data yet. Select a location and click <strong>Submit</strong>.
        </p>
      </div>
    );
  }

  const { lat, lon, startDay, range, results, chosenDate } = forecastData;

  if (!results) {
    return (
      <div className="forecast-result">
        <h3>Forecast Overview</h3>
        <p style={{ color: '#777' }}>
          No results were returned from the backend.
        </p>
      </div>
    );
  }

  // We'll figure out which parameters exist
  const hasTemp = results.temperature && results.temperature.length > 0;
  const hasWind = results.wind && results.wind.length > 0;
  const hasRain = results.rain && results.rain.length > 0;
  const hasMoisture = results.moisture && results.moisture.length > 0;

  // We'll create an array for each day, e.g. [0..range-1], then display in rows
  const daysArray = Array.from({ length: range }, (_, i) => startDay + i);

  return (
    <div className="forecast-result">
      <h3>Forecast Overview</h3>
      <p><strong>Chosen Date:</strong> {chosenDate}</p>
      <p><strong>Coordinates:</strong> {lat.toFixed(5)}, {lon.toFixed(5)}</p>
      <p><strong>Day of Year Start:</strong> {startDay}</p>
      <p><strong>Forecast Range:</strong> {range} days</p>

      <div style={{ overflowX: 'auto', marginTop: '1rem' }}>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ backgroundColor: '#f0f0f0' }}>
              <th style={{ padding: '8px', border: '1px solid #ccc' }}>Day of Year</th>
              {hasTemp && <th style={{ padding: '8px', border: '1px solid #ccc' }}>Temperature</th>}
              {hasWind && <th style={{ padding: '8px', border: '1px solid #ccc' }}>Wind (km/h)</th>}
              {hasRain && <th style={{ padding: '8px', border: '1px solid #ccc' }}>Rain (mm)</th>}
              {hasMoisture && <th style={{ padding: '8px', border: '1px solid #ccc' }}>Moisture</th>}
            </tr>
          </thead>
          <tbody>
            {daysArray.map((dayOffset, idx) => (
              <tr key={idx}>
                <td style={{ padding: '8px', border: '1px solid #ccc' }}>
                  {dayOffset}
                </td>
                {hasTemp && (
                  <td style={{ padding: '8px', border: '1px solid #ccc' }}>
                    {results.temperature[idx]?.toFixed(2)}
                  </td>
                )}
                {hasWind && (
                  <td style={{ padding: '8px', border: '1px solid #ccc' }}>
                    {results.wind[idx]?.toFixed(2)}
                  </td>
                )}
                {hasRain && (
                  <td style={{ padding: '8px', border: '1px solid #ccc' }}>
                    {results.rain[idx]?.toFixed(2)}
                  </td>
                )}
                {hasMoisture && (
                  <td style={{ padding: '8px', border: '1px solid #ccc' }}>
                    {results.moisture[idx]?.toFixed(2)}
                  </td>
                )}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Example alert section */}
      <div className="alert-section" style={{ marginTop: '1rem' }}>
        <h3>Weather Alerts</h3>
        <p>No active alerts.</p>
      </div>
    </div>
  );
}

export default ForecastResult;
